-- ----------------------------
--  Table structure for `st_auth_action_main`
-- ----------------------------
DROP TABLE IF EXISTS `st_auth_action_main`;
CREATE TABLE `st_auth_action_main` (
  `action_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `action` varchar(100) NOT NULL DEFAULT '' COMMENT '权限 主要用户关联',
  `action_name` varchar(100) NOT NULL DEFAULT '' COMMENT '权限名称',
  `create_admin_id` int(10) NOT NULL DEFAULT '0' COMMENT '创建人id',
  `create_admin_name` varchar(100) NOT NULL DEFAULT '后台创建' COMMENT '创建人名称',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `type` varchar(10) NOT NULL DEFAULT '' COMMENT '类型',
  `status` int(10) NOT NULL DEFAULT '1' COMMENT '状态1正常，0不正常',
  PRIMARY KEY (`action_id`),
  KEY `action` (`action`)
) ENGINE=InnoDB AUTO_INCREMENT=120 DEFAULT CHARSET=utf8;

