-- ----------------------------
--  Table structure for `st_business_bind`
-- ----------------------------
DROP TABLE IF EXISTS `st_business_bind`;
CREATE TABLE `st_business_bind` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `platform_token` varchar(60) NOT NULL DEFAULT '' COMMENT '平台token， 对应toon平台的feedId',
  `business_id` int(10) NOT NULL DEFAULT '0' COMMENT '食客端平台用户uid',
  `admin_id` int(10) NOT NULL,
  `memo` blob,
  `create_time` int(10) NOT NULL DEFAULT '0' COMMENT '绑定时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_platform_type` (`platform_token`)
) ENGINE=InnoDB AUTO_INCREMENT=147 DEFAULT CHARSET=utf8 COMMENT='商家端绑定Toon关系表';

