-- ----------------------------
--  Table structure for `st_log`
-- ----------------------------
DROP TABLE IF EXISTS `st_log`;
CREATE TABLE `st_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'LOG_ID',
  `log_info` text NOT NULL COMMENT '日志备注',
  `log_time` int(11) NOT NULL DEFAULT '0' COMMENT '日志时间',
  `log_type` int(11) NOT NULL DEFAULT '0' COMMENT '日志类型',
  `user_type` int(11) NOT NULL DEFAULT '0' COMMENT '用户类型，1用户，2员工，3管理员',
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户ID',
  `log_ip` varchar(255) NOT NULL DEFAULT '' COMMENT '用户IP',
  `log_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '状态，1正常，0删除',
  `module` varchar(255) NOT NULL DEFAULT '' COMMENT '调用接口',
  `action` varchar(1000) NOT NULL DEFAULT '' COMMENT '接口方法',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=17581 DEFAULT CHARSET=utf8;

